  \"2016-07-13T01:11:02.901695\",\n\t\"name\": \"nationwide-rivers-inventory\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Nationwide Rivers Inventory (NRI) is
  a listing of more than 3,400 free-flowing river segments in the United States that
  are believed to possess one or more \"outstandingly remarkable\" natural or cultural
  values judged to be of more than local or regional significance. Under a 1979 Presidential
  Directive, and related Council on Environmental Quality procedures, all federal
  agencies must seek to avoid or mitigate actions that would adversely affect one
  or more NRI segments.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
